  return (
    <View style={styles.container}>
      <Text style={styles.title}>Event</Text>
      <View style={styles.separator} lightColor="#eee" darkColor="rgba(255,255,255,0.1)" />

      {/* <EditScreenInfo path="/screens/EventScreen.tsx" /> */}
